    @Test
    public void entradaESaidaManual() throws IOException {
        inicioExecucao = new DateTime(2017, 1, 10, 17, 58, 0);
        controlador = getControlador();
        Motor motor = new Motor(controlador, inicioExecucao, this);

        avancarSegundos(motor, 83);
        acionarModoManual(motor);
        avancarSegundos(motor, 100);

        motor.getEstagios().stream().forEach(gerenciadorDeEstagios -> {
            assertEquals(ModoOperacaoPlano.MANUAL, gerenciadorDeEstagios.getPlano().getModoOperacao());
        });

        avancarSegundos(motor, 200);

        assertTrue(ativacaoModoManual.get(inicioExecucao.plusSeconds(130)));
        assertTrue(desativacaoModoManual.get(inicioExecucao.plusSeconds(289)));

        motor.getEstagios().stream().forEach(gerenciadorDeEstagios -> {
            assertEquals(ModoOperacaoPlano.TEMPO_FIXO_COORDENADO, gerenciadorDeEstagios.getPlano().getModoOperacao());
            assertEquals(3, gerenciadorDeEstagios.getPlano().getPosicao().intValue());
        });
    }

    @Test
    public void validaVerdeSegurancaModoManual() throws IOException {
        inicioExecucao = new DateTime(2017, 1, 10, 17, 58, 0);
        controlador = getControlador();
        Motor motor = new Motor(controlador, inicioExecucao, this);

        avancarSegundos(motor, 63);
        acionarModoManual(motor);
        avancarSegundos(motor, 89);
        trocarEstagioModoManual(motor);
        avancarSegundos(motor, 300);

        assertTrue(ativacaoModoManual.get(inicioExecucao.plusSeconds(130)));
        assertEquals(inicioExecucao.plusSeconds(151), listaTrocaManualLiberada.get(0));
        assertEquals(inicioExecucao.plusSeconds(163), listaTrocaManualLiberada.get(1));
    }

    @Test
    public void erroTrocaEstagioManual() throws IOException {
        inicioExecucao = new DateTime(2017, 1, 10, 17, 58, 0);
        controlador = getControlador();
        Motor motor = new Motor(controlador, inicioExecucao, this);

        avancarSegundos(motor, 25);
        acionarModoManual(motor);
        avancarSegundos(motor, 75);
        trocarEstagioModoManual(motor);
        avancarSegundos(motor, 300);

        assertTrue(desativacaoModoManual.get(inicioExecucao.plusSeconds(126)));

        assertEquals("E4", 4, listaEstagios.get(inicioExecucao.plusSeconds(126)).get(1).getEstagio().getPosicao().intValue());

        assertEquals("E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(260)).get(1).getEstagio().getPosicao().intValue());
        assertEquals("E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(270)).get(2).getEstagio().getPosicao().intValue());
    }

